function calcula_cifra_control_it(r){var t=r,n=parseInt(t.substr(0,6)),a=parseInt(t.substr(7));if(n<=0)return!1;if(a<1||100<a&&120!=a&&121!=a)return!1;var e,o=0;for(e=0;e<t.length;e+=2)o+=parseInt(t.substr(e,1));var s,i=0;for(e=1;e<t.length;e+=2)result=2*parseInt(t.substr(e,1)),1==String(result).length?i+=parseInt(result):i=i+parseInt(String(result).substr(0,1))+parseInt(String(result).substr(1,1));return s=10<(o+=i)?String(o).substr(1,1):o,10==(s=10-parseInt(s))&&(s=0),s.toString()}function genera_nif_it(){var r=Math.floor(1e7*Math.random()),t=Math.floor(100*Math.random()),n=pad(r.toString(),7)+pad(t.toString(),3),a=calcula_cifra_control_it(n);return a?n+a:genera_nif_it()}function calcula_cifra_control_be(r){var t=pad(r,8);if(parseInt(t.substr(1,1))<2)return!1;var n=97-parseInt(t)%97;return pad(n.toString(),2)}function genera_nif_be(){var r=Math.floor(1e8*Math.random()),t=pad(r.toString(),8),n=calcula_cifra_control_be(t);return n?t+n:genera_nif_be()}function calcula_cifra_control_at(r){var t=0,n=0,a=0,e=0;for(n=0;n<r.length;n+=2)t+=parseInt(r.substr(n,1));for(n=1;n<r.length;n+=2)e=2*parseInt(r.substr(n,1)),1==String(e).length?a+=parseInt(e):a=a+parseInt(String(e).substr(0,1))+parseInt(String(e).substr(1,1));var o,s=t+a;return console.info("S:"+s),o=10-(s+4)%10,console.info("C:"+o),10==o&&(o=0),console.info("C:"+o),o.toString()}function genera_nif_at(){var r=Math.floor(1e7*Math.random()),t=pad(r.toString(),7),n=calcula_cifra_control_at(t);return n?"U"+t+n:genera_nif_at()}